import React from 'react';
import "./App.css";
import AppBar from "./Components/AppBar";
import FormCard from "./Components/FormCard";

const App: React.FC = () => {
  return (
    <div className="App">
      <AppBar/>
      <FormCard/>
    </div>
  );
}

export default App;
